import React from "react";
import img1 from '../images/arijit.png';
import img2 from '../images/aujla.png';
import img3 from '../images/aujla.png';
import img from '../images/aujla.png';

const Live=()=>{

    return(
        <div>
            <img src={img1} alt=""/>
            <img src={img2} alt=""/>
        </div>
    )
}
export default Live;
